import React from 'react';
import { Image, } from 'react-native';

const LogoTitle = () => {
    return (
      <Image
        style={{ width: 50, height: 50 }}
        source={{
            width: 30,
            height: 30,
            uri:'https://picsum.photos/200/300'}}
      />
    );
  }

  export default LogoTitle;
